import React from 'react';
import { useNavigate } from 'react-router-dom';  // Replace useHistory with useNavigate

const Game = () => {
    const navigate = useNavigate(); // useNavigate hook

    // Example function to handle back navigation (for going back to levels)
    const handleGoBack = () => {
        navigate('/levels');  // Navigate back to the levels page
    };

    return (
        <div>
            <h1>Banana Game</h1>
            <p>Welcome to the game. Start playing!</p>
            <button onClick={handleGoBack}>Back to Levels</button>
        </div>
    );
};

export default Game;
